// H1vertical.js
import React from 'react'
import './h1vertical.css' // Ensure the file name matches exactly

const H1verticalRight = () => {
  return (
    <div className="vertical-container">
      <h1 className="h1right text-white text-5xl font-bold">Note Taker</h1>
    </div>
  )
}
const H1VerticalLeft = () => {
  return (
    <div className="vertical-container left">
      <h1 className="h1vertical text-white text-5xl font-bold">Note Taker</h1>
    </div>
  )
}

export default { H1VerticalLeft, H1verticalRight }
